import React from 'react';
import raphael from '../../images/RaphaelSinge.jpeg';

const Home = () => {

    return (
    <div className="home">
        <p className='home-content'>
            Hello, <br/>
            <span>I</span>'m Raphael Honigstein,<br/>
            French Web Developer, <br/>
            Full Stack JavaScript .
        </p>

        <div className='home-profil'>
            <img className='home-pic' src={raphael} alt="Raphael"/>
        </div>
    </div>

    )
};

export default Home;
